column8:
切り替え部分や表布と見返し布の間にはさんで飾ります。<br>
バッグなどの縁に使うと補強の役目も果たします。<br><br>

◆素材：ポリエステル65％、綿35％　（色番：399生成のみ 綿100％）<br>
◆サイズ（約）：巾10ｍｍ、長さ2.75ｍ<br>
◆タイプ：パイピング<br><br>

※画像とは色合いが異なる場合がございます。<br>

<p style="color:#00cc33;font-weight:bold;font-size:12px;">★色番「301～337」までは<br>　 →こちら</p>

<br>
※メーカー希望小売価格はメーカーサイトに基づいて掲載しています。<br>
